import React from 'react';
import ReactDOM from 'react-dom';
import TodoApp from './TodoApp'; // assuming TodoApp component is in TodoApp.js

ReactDOM.render(
  <React.StrictMode>
    <TodoApp />
  </React.StrictMode>,
  document.getElementById('root')
);

const App = () => {
  <div>
    <TodoApp />
  </div>
}

export default App
